CREATE DATABASE carsharing;
USE carsharing;


CREATE TABLE `users` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `name` varchar(255),
  `surname` varchar(255),
  `street` varchar(255),
  `city` varchar(255),
  `phone_number` varchar(255),
  `email` varchar(255),
  `login` varchar(255),
  `status` ENUM ('B', 'B1', 'Blocked', 'Verified'),
  `discount` float DEFAULT 0
);

CREATE TABLE `credentials` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `id_user` int,
  `email` varchar(255),
  `login` varchar(255),
  `password_hash` varchar(255),
  `password_salt` varchar(255)
);

CREATE TABLE `unverified_users` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `email` varchar(255),
  `login` varchar(255),
  `password_hash` varchar(255),
  `password_salt` varchar(255),
  `url` varchar(255),
  `ttl` datetime DEFAULT CURRENT_TIMESTAMP,
  `status` bool
);

CREATE TABLE `payment` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `id_user` int,
  `card_last_digits` int,
  `provider` varchar(255),
  `payment_token` varchar(255),
  `exp_date` date
);

CREATE TABLE `document` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `id_user` int,
  `api_url` varchar(255),
  `exp_date` date,
  `document_number` varchar(255),
  `ext_checker_info` varchar(255),
  `img_obverse` mediumblob,
  `img_reverse` mediumblob,
  `img_selfie` mediumblob
);

CREATE TABLE `renting` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `id_user` int,
  `id_car` int,
  `car_route` float,
  `time_start` datetime,
  `time_finished` datetime,
  `time_stop` time,
  `time_reservation` time,
  `status` bool,
  `cost` float,
  `route` mediumtext
);

CREATE TABLE `classes` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `name` varchar(255),
  `start_fee` float,
  `minute_fee` float,
  `kilometer_fee` float,
  `stop_7_23` float,
  `stop_23_7` float
);

CREATE TABLE `leasing_company` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `name` varchar(255),
  `address` varchar(255),
  `phone_number` varchar(255),
  `bank_number` varchar(30)
);

CREATE TABLE `leasing` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `leasing_company_id` int,
  `month` int,
  `monthly_price` float,
  `start_date` date
);

CREATE TABLE `car_brands` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `manufacturer` varchar(255)
);

CREATE TABLE `cars` (
  `id` int PRIMARY KEY AUTO_INCREMENT,
  `leasing_id` int,
  `brand_id` int,
  `class_id` int,
  `fuel_card` varchar(255),
  `VIN_number` varchar(255),
  `model` varchar(255),
  `generation` varchar(255),
  `car_year` year,
  `engine_type` varchar(255),
  `gearbox` varchar(255),
  `fuel_battery_level` int,
  `car_mileage` int,
  `status` ENUM ('Ready_to_rent', 'Rented', 'Need_fuel', 'Broken'),
  `localization_x` varchar(255),
  `localization_y` varchar(255)
);

ALTER TABLE `credentials` ADD FOREIGN KEY (`id_user`) REFERENCES `users` (`id`);

ALTER TABLE `payment` ADD FOREIGN KEY (`id_user`) REFERENCES `users` (`id`);

ALTER TABLE `document` ADD FOREIGN KEY (`id_user`) REFERENCES `users` (`id`);

ALTER TABLE `renting` ADD FOREIGN KEY (`id_user`) REFERENCES `users` (`id`);

ALTER TABLE `renting` ADD FOREIGN KEY (`id_car`) REFERENCES `cars` (`id`);

ALTER TABLE `leasing` ADD FOREIGN KEY (`leasing_company_id`) REFERENCES `leasing_company` (`id`);

ALTER TABLE `cars` ADD FOREIGN KEY (`leasing_id`) REFERENCES `leasing` (`id`);

ALTER TABLE `cars` ADD FOREIGN KEY (`brand_id`) REFERENCES `car_brands` (`id`);

ALTER TABLE `cars` ADD FOREIGN KEY (`class_id`) REFERENCES `classes` (`id`);




























